import React, { useState } from 'react';
import GenderDropdown from './dropdowns/GenderDropdown';
import LetterDropdown from './dropdowns/LetterDropdown';
import OriginDropdown from './dropdowns/CountryDropdown';
import { Genders } from './dropdowns/menus/options';
import { letters } from './dropdowns/menus/options';
import { country } from './dropdowns/menus/options';
import './App.css'

function App() {
  const [selectedGender, setSelectedGender] = useState('');
  const [selectedLetter, setSelectedLetter] = useState('');
  const [selectedOrigin, setSelectedOrigin] = useState('');

  const handleSelectGender = (selectedOption) => {
      setSelectedGender(selectedOption.value);
  };

  const handleSelectLetter = (selectedOption) => {
      setSelectedLetter(selectedOption.value);
  };

  const handleSelectOrigin = (selectedOption) => {
      setSelectedOrigin(selectedOption.value);
  };

  const handleSubmit = () => {
      if (!selectedGender || !selectedLetter || !selectedOrigin) {
          alert('Please select gender, letter, and origin.');
          return;
      }
      console.log('Selected gender:', selectedGender);
      console.log('Selected letter:', selectedLetter);
      console.log('Selected origin:', selectedOrigin);
  };

  return (
      <div className="App">
          <h1>Baby Name Generator</h1>
          <GenderDropdown onSelectGender={handleSelectGender} />
          <LetterDropdown onSelectLetter={handleSelectLetter} />
          <OriginDropdown options={country} onSelectOrigin={handleSelectOrigin} />
          <button onClick={handleSubmit}>Submit</button>
      </div>
  );
}

export default App;
